"""
InnovLead Vault - ConsultancyBot Installer
Run this script in Replit to install/upgrade the ConsultancyBot package.
"""
import os
import base64
from pathlib import Path

# File contents (Base64 encoded)
FILES = {
    "replit_vault/consultancy_bot/bot.py": "",
    "replit_vault/consultancy_bot/competitor_research.py": "",
    "replit_vault/consultancy_bot/proposal_generator.py": "",
    "replit_vault/consultancy_bot/README.md": "",
    "replit_vault/consultancy_bot/test_bot.py": "",
    "replit_vault/consultancy_bot/__init__.py": "",
    "replit_vault/consultancy_bot/templates/executive_summary.md": "",
}

def install():
    print(" Installing ConsultancyBot...")
    
    for file_path, b64_content in FILES.items():
        # Create directory
        path = Path(file_path)
        path.parent.mkdir(parents=True, exist_ok=True)
        
        # Decode and write
        content = base64.b64decode(b64_content)
        with open(path, "wb") as f:
            f.write(content)
        
        print(f"   Installed: {file_path}")
    
    print("\n Installation Complete!")
    print("Now update your server.py to use the new module.")

if __name__ == "__main__":
    install()